import styled from "styled-components";

export const MenuHome = styled.div`
  align-items: center;
  display: grid;
  grid-template-columns: repeat(3, 1fr);
  justify-items: center;
  background-color: #fff;
  width: 377px;
  height: 60px;
  border-top: 1px solid #bfbfbf;
  position: fixed;
  bottom: 0px;
`;
